import React, { Component } from "react";
import {
  View,
  Text,
  ScrollView,
  TouchableOpacity,
  Dimensions,
  StyleSheet,
  ActivityIndicator,
  Image,
  Pressable
} from "react-native";
// import Modal from "react-native-modal";
// import BottomSheet from "reanimated-bottom-sheet";
import RBSheet from "react-native-raw-bottom-sheet";
import {
  createStackNavigator,
  HeaderBackButton
} from "@react-navigation/stack";
import { NavigationContainer } from "@react-navigation/native";
import { Rating, AirbnbRating } from "react-native-elements";
import {
  Searchbar,
  IconButton,
  Colors,
  Button,
  Title,
  Avatar,
  Card,
  Paragraph,
  ProgressBar
} from "react-native-paper";
import { connect } from "react-redux";
import { colors } from "../../../constants/colors";
import TextDisplay from "../librairy/text";
import LogoOther from "../librairy/logo-other";
import ButtonDisplay from "../librairy/button";
import { FontAwesome, Ionicons, MaterialIcons } from "@expo/vector-icons";
import Carousel from "react-native-snap-carousel";
import MyCarousel from "../element/carousel";
import key from "../../../../assets/key.png";
import dist from "../../../../assets/dist.png";
import Tabs from "../../tabs";
import tabs from "../../tabs";
import { SafeAreaView } from "react-native-safe-area-context";

const height = Math.round(Dimensions.get("window").height);
const width = Math.round(Dimensions.get("window").width);

const images = [
  require("../../../../assets/images/AccountPage/Card1.png"),
  require("../../../../assets/images/AccountPage/Card2.png"),
  require("../../../../assets/images/AccountPage/Card3.png")
];

const data = [
  {
    title: "Aenean leo",
    body: "Ut tincidunt tincidunt erat. Sed cursus turpis vitae tortor. Quisque malesuada placerat nisl. Donec quam felis, ultricies nec, pellentesque eu, pretium quis, sem.",
    imgUrl: "../../../../assets/images/eva_menu-fill.png"
  },
  {
    title: "In turpis",
    body: "Aenean ut eros et nisl sagittis vestibulum. Donec posuere vulputate arcu. Proin faucibus arcu quis ante. Curabitur at lacus ac velit ornare lobortis. ",
    imgUrl: "https://picsum.photos/id/10/200/300"
  },
  {
    title: "Lorem Ipsum",
    body: "Phasellus ullamcorper ipsum rutrum nunc. Nullam quis ante. Etiam ultricies nisi vel augue. Aenean tellus metus, bibendum sed, posuere ac, mattis non, nunc.",
    imgUrl: "https://picsum.photos/id/12/200/300"
  }
];

const CarouselCardItem = ({ item, index }) => {
  return (
    <View style={{ alignItems: "center" }} key={index}>
      <Image
        source={{ uri: item.imgUrl }}
        style={{ height: 100, width: 300 }}
      />
    </View>
  );
};

class Account extends Component {
  render() {
    return (
      <SafeAreaView style={{ backgroundColor: "#F6F7FB", height: "100%" }}>
        <View
          style={{
            flexDirection: "row",
            marginLeft: 10,
            justifyContent: "flex-start",
            alignItems: "center",
            marginRight: "45%"
          }}
        >
          <Tabs />
          <Text style={{ fontSize: 20, fontWeight: "bold" }}>SIIC</Text>
        </View>
        <View>
          <MyCarousel
            images={images}
            dotColor={colors[3]}
            resizeMethod={"resize"}
            resizeMode={"cover"}
            sliderBoxHeight={180}
            ImageComponentStyle={{
              borderRadius: 10,
              width: width * 0.87,
              height: 180,
              marginBottom: 120
            }}
            imageLoadingColor={colors[2]}
          />
          <View style={{ marginLeft: 20, position: "relative", bottom: 120 }}>
            <Text>Quick actions</Text>
            <View
              style={{ flexDirection: "row", justifyContent: "space-around" }}
            >
              <TouchableOpacity onPress={() => {}}>
                <Image
                  style={{ marginTop: 15, marginRight: 10 }}
                  source={require("../../../../assets/images/AccountPage/bank-transfert.png")}
                />
              </TouchableOpacity>

              <TouchableOpacity onPress={() => {}}>
                <Image
                  style={{ marginTop: 25, marginRight: 10 }}
                  source={require("../../../../assets/images/AccountPage/ask-money.png")}
                />
              </TouchableOpacity>

              <TouchableOpacity onPress={() => {}}>
                <Image
                  style={{ marginTop: 20, marginRight: 10 }}
                  source={require("../../../../assets/images/AccountPage/reload.png")}
                />
              </TouchableOpacity>
              <TouchableOpacity onPress={() => {}}>
                <Image
                  style={{ marginTop: 15, marginRight: 10 }}
                  source={require("../../../../assets/images/AccountPage/block.png")}
                />
              </TouchableOpacity>
            </View>
          </View>
        </View>
      </SafeAreaView>
    );
  }
}

const mapStateToProps = (state) => {
  return {
    user: state.user,
    token: state.token
  };
};

const mapDispatchStoreToProps = (dispatch) => {
  return {};
};

export default connect(mapStateToProps, mapDispatchStoreToProps)(Account);
